INSERT INTO `article` VALUES (1,'광주에서 추리테마 방탈출 같이 하실분 2명 구합니다.','2022-04-07 20:16:01','전라',NULL,'민기',0,0,'광주','이번주 주말에 같이 방탈출 하실 분 2명 구합니다.',35634012,'https://lh3.googleusercontent.com/a/AATXAJy2ew9j8WhIJa8zgJNfBOzczeQQ4LVI2R88T-_N=s96-c'),(2,'저희 2명인데 같이 방탈출하실 두 분 추가로 모집합니다:) \n실력은 상관없어요~\n\n\n댓글 남겨주세요!!\n\n--모집완료--','2022-04-07 20:20:46','서울','2022-04-07 21:27:45','탈출하이',0,0,'홍대','[마감] 이번주 홍대 방탈출 같이 가실 분 구해요!',64240486,'https://escape-user-bucket.s3.ap-northeast-2.amazonaws.com/4851c8f5-d678-4e2f-9549-d6bfb0fc5b48.jpg'),(3,'저 테마 엄청 유명한 테마고 완전 재밌대요 \n참고로 저는 방탈출 경험 50번입니다. 방탈출 경험 최소 20번 이상이면 좋겠고, 3명 구해요~','2022-04-07 20:35:03','서울',NULL,'소진',0,0,'홍대','4/9 토요일 18:00 홍대 꼬레아우라 같이 하실분 ',69462370,'https://lh3.googleusercontent.com/a-/AOh14Gi2lZ5uhz5JTZu_xjQd7iHAe9E_w-Fwf8FnSdD1pg=s96-c'),(4,'같이 방탈출 하실 분 구해요~','2022-04-07 20:56:41','경기/인천',NULL,'하루',0,0,'수원','이번 주 금요일 저녁에 방탈출 하실 분 있나요?',73982550,'https://lh3.googleusercontent.com/a-/AOh14GiAuRHfwtFAWGSpNJTr9n8d_75ROxZrwfwPlTpT=s96-c'),(5,'adddsdf4934\n카톡친추주세요.','2022-04-07 22:20:48','서울',NULL,'판승',0,0,'강남','4월 9일 강남 공포테마 파티 구함',65027815,'https://escape-user-bucket.s3.ap-northeast-2.amazonaws.com/d65797d3-9d17-452b-89f3-3bb268d4008c.png'),(6,'테마 상관없어여. 파티구해요!','2022-04-07 22:29:47','경기/인천',NULL,'깨보자!',0,0,'수원','수원에서 이번주 토욜 낮 12시',29159124,'https://lh3.googleusercontent.com/a-/AOh14GiN8vjaS4vGy7kRWb30iWUe9F-ZWNTVqCF_N8KB=s96-c'),(7,'이번주 주말저녁에 같이 하실 두분 구합니다.','2022-04-07 22:56:30','서울',NULL,'룰루',0,0,'건대','건대에서 테마 2개 같이 하실분 구해요!',64240486,'https://escape-user-bucket.s3.ap-northeast-2.amazonaws.com/2525583d-a5bf-47c2-b0eb-20051bb64329.jpg'),(8,'저희 이번주 토요일에 광주 전대에 위치한 숨바꼭질의 명당이라는 테마를 하려고 합니다.\n어려울 것 같아서 같이 하실 한 분 구해요!!','2022-04-07 23:08:39','전라',NULL,'지애',0,0,'광주','같이 방탈출 하실 분 구해요!!',73982550,'https://escape-user-bucket.s3.ap-northeast-2.amazonaws.com/8f6fa23d-ab2c-421a-bb03-cdc2c22ed1b5.jpg');
