INSERT INTO `notice` VALUES (1,'안녕하세요 디코드입니다.\n\n현재 제공되는 기능은 프로필, 정보 페이지, 추천페이지, 공지게시판, 유저게시판 입니다.\n\n프로필 페이지에서는 회원정보 수정 및 지금까지 클리어한 방탈출 테마와 작성한 게시글, 댓글 등을 확인하실 수 있습니다.\n\n정보 페이지에서는 필터링 기능과 함께 디코드가 가진 방탈출 카페 테마 정보를 제공합니다.\n\n추천페이지에서는 유저분들의 취향을 저격할 방탈출 카페 테마 추천이 제공되니 많은 기대 부탁드립니다.\n\n혹시나 문의사항이 생기신다면 공지게시판에 Q&A를 남겨주세요\n\n유저게시판에서는 유저분들의 자유로운 소통은 물론 함께 방탈출을 할 일행을 구하실 수 있습니다.\n\n많은 이용부탁드리며 저희 디코드를 찾아주셔서 감사합니다.','2022-04-07 20:49:19',_binary '',_binary '','2022-04-07 20:51:20','관리자','디코드 이용안내',90489394,'http://k.kakaocdn.net/dn/AW19K/btrtNRUndFL/DUCkj2MZHfwkDkvJBqyU60/p1.jpg');
/*!40000 ALTER TABLE `notice` ENABLE KEYS */;
